import React from "react";
// import Search from "../pages/search";
// import API from "../../utils/API"
// import Search from "../pages/search"
import "./style.css";

function Result (props) {
    return (
        <ul className="result">
            {props.books.map(book => (
                <li
                    key={book.id}
                    id={book.id}
                >
                    <img src={book.image} />
                    <p>id: {book.id}</p>
                    <p>googleLink: {book.googleLink}</p>
                    <p>{book.title}</p>
                </li>
            ))}
        </ul>
    )
 }

export default Result;
